script: |
  super -f text -I q12823.spq | sort > q12823.out

inputs:
  - name: q12823.spq
    data: |
      SELECT ALL col2 AS col2 FROM tab2 (FORMAT parquet) WHERE 44 * col1 + 53 * col2 NOT BETWEEN + col0 AND ( + 89 + - col2 );
  - name: tab2

outputs:
  - name: q12823.out
    data: |
      23
      40
      58
